    }

  render () {
      return (
          <div className="login">
              Login Form
              <Form>
                  <Input type={"text"} placeHolder={"Username"} value={this.state.user.username} onchange={(e) => this.handleChange} />
                  <Input type={"password"} placeHolder={"Password"} value={this.state.user.password} onchange={(e)=>this.handleChange} />
                  <Button />
              </Form>
           
      </div>
    );
  }
}
